    false,nt"url": null,nt"notes": "The AHS is the largest, regular national
    housing sample survey in the United States. The U.S. Census Bureau conducts the
    AHS to obtain up-to-date housing statistics for the Department of Housing and Urban
    Development (HUD). The AHS contains a wealth of information that can be used by
    professionals in nearly every field for planning, decisionmaking, market research,
    or various kinds of program development. It gives you data on apartments, single-family
    homes, mobile homes, vacant homes, family composition, income, housing and neighborhood
    quality, housing costs, equipment, fuels, size of housing unit, and recent movers.",nt"license_title":
